const Categories = ({ items }) => {
    return (
        <div className="categories">
            <ul>
                <li className="active">Все</li>
                {items.map((name) =>
                    <li onClick={() => onClick(name)} key={name}>
                        {name}
                    </li>
                )}
            </ul>
        </div>
    )
}

export default Categories
